package ABC_Collagex;public class Hostelers extends Student{    private String hostelName;    private int roomNo;    private long phoneNo;    public  Hostelers(){        super();        hostelName="RajGAD";        roomNo=1;        phoneNo=100000001;    }    public Hostelers(int studid,String name,int deptID,String hostelName,int roomNo,long phoneNo){        super(studid, name, deptID);        this.hostelName=hostelName;        this.roomNo=roomNo;        this.phoneNo=phoneNo;    }    public int getRoomNo() {        return roomNo;    }    public long getPhoneNo() {        return phoneNo;    }    public void setPhoneNo(long phoneNo) {        this.phoneNo = phoneNo;    }    public void setRoomNo(int roomNo) {        this.roomNo = roomNo;    }    public String showD() {        return super.toString()+"Student Hostel Name "+hostelName+"Student room no"+roomNo+"Student Phone No"+phoneNo;    }}